// src/components/Robot.js
import React from 'react';
import '../styles/Robot.scss'; // Importez le fichier SCSS

const Robot = () => {
    return (
        <div className="robot">
            <img src="https://example.com/robot.png" alt="Robot" />
        </div>
    );
};

export default Robot;
